import BusinessObject from "./BusinessObject";

export default class Task2 extends BusinessObject{

	constructor(aduration, awrongetiles, aidrun){
		super()
        this.duration = aduration
        this.wrongetiles = awrongetiles
        this.idrun = aidrun	
    }

	/**
	 * Gibt die ID des Business Object wieder.
	 */
	getDuration() {
		return this.id;
	}


	/**
	 * Gibt die ID des Business Object wieder.
	 */
	getWrongTiles() {
		return this.id;
	}


    static fromJSON(task2) {
		let results = null;
		if (Array.isArray(task2)) {
			results = [];
			task2.forEach((x) => {
				Object.setPrototypeOf(x, Task2.prototype);
				results.push(x);
			})
		} else {
			let x = task2;
			Object.setPrototypeOf(x, Task2.prototype);
			results = x;
		}
		return results;
	}
}
